E_D("replace into `phome_ecms_game` values('6085','14','0','','','','1','admin','','1','0','1343237217','0','0','0','0','','','6085','0','0','0','0','0','0','童年女生版','1343237217','/spic/20120725/10734.jpg','0','1','1343237217','0','3','1','0','','0','','/d/file/swf/1841.swf','667','479','池塘边的榕树上,知了在声声叫着夏天，<br />草丛边的秋千上,只有蝴蝶停在上面，<br />黑板上老师的粉笔还在拼命叽叽喳喳写个不停，<br />等待着下课等待着放学等待游戏的童年，<br />福利社里面什么都有就是口袋里没有半毛钱。<br />诸葛四郎和魔鬼党到底谁抢到那支宝剑,<br />隔壁班的那个女孩怎么还没经过我的窗前,<br />嘴里的历史手里的漫画心里初恋的童年,<br />总是要等到睡觉前才知道功课只做了一点点,<br />总是要等到考试后才知道该念的书都没有念,<br />一寸光阴一寸金老师说过寸金难买寸光阴,<br />一天又一天一年又一年迷迷糊糊的童年,没有人知道为什么太阳总下到山的那一边,<br />没有人能够告诉我山里面有没有住着神仙,多少平日记忆总是一个人面对着天空发呆,<br />就这么好奇就这么幻想这么孤单的童年,阳光下蜻蜓飞过来一片片绿油油的稻田,<br />水彩蜡笔和万花筒画不出天边那一条彩虹,什么时候才能像高年级的同学有张成熟与长大的脸,<br />盼望着假期盼望着明天盼望长大的童年,一天又一天一年又一年盼望长大的童年 .','1','','0','','1','/dpic/20120725/10735.jpg','1841','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVrVTBUa1JGZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/1841.swf','http://www.61baobao.com/common/flash/d/dpic/1841.jpg','http://www.61baobao.com/common/flash/d/pic/1841.jpg','0','三个月以上','0','','0','','0','0','0');");
