E_D("replace into `phome_ecms_game` values('6156','14','0','','','','1','admin','|26|60|','1','0','1343237242','0','0','0','0','','','6156','0','0','0','0','0','0','听妈妈的话','1343237242','/spic/20120725/10953.jpg','0','1','1343237242','0','3','1','0','','0','','/d/file/swf/1765.swf','667','479','小朋友 你是否有很多问号,为什麼 别人在那看漫画,<br />我却在学画画 对著钢琴说话,别人在玩游戏,<br />我却靠在墙壁背我的ABC ,我说我要一架大大的飞机 。<br />我却得到一只旧旧螺旋机 ,为什麼要听妈妈的话 <br />长大后你就会开始懂得这种话 哼 ,<br />长大后我开始明白 为什麼我 ,跑的比别人快 飞的比别人高 <br />将来大家看的都是我画的漫画 ,<br />大家唱的都是 我写的歌 ,妈妈的辛苦 不让你看见 <br />温柔的事 是否在她心里面 ,有空就多多握著她的手 <br />把手牵著一起梦游 ,<br /><br />听妈妈的话 ,听妈妈的话 别让她受伤 <br />想快快长大 才能保护她 ,美丽的白发 幸福中发芽 <br />天使的魔法 温暖中慈祥 ,<br />在你的未来 音乐是你的王牌 ,那王牌谈个恋爱 而我不想被你教坏 <br />还是听妈妈的话吧 晚点在恋爱吧 ,我知道你未来的路 干嘛比我更清楚 <br />你因为太多学习的同学在这块写东写西 ,<br />但我在 妈妈我会用功读书 ,用功读书怎麼会从我嘴巴说出 <br />不想你输所以要叫你用功读书吗 ,妈妈交给你的毛笔你要好好收著 <br />因为不许告诉我 也告诉他我还留著 ,对了 我会遇到了周润发 <br />所以你可以跟同学炫耀 赌神未来是你爸爸 ,<br />我找不到你写的情书 ,你喜欢的要承认 ,<br />因为我会了解你会在操场上牵她 ,你会开始喜欢唱流行歌 <br />因为张学友开始准备唱吻别 ,<br /><br />听妈妈的话 别让她受伤 ,想快快长大 才能保护她 <br />美丽的白发 幸福中发芽 ,天使的魔法 温暖中慈祥 <br /><br />长大后我开始明白 为什麼我 ,跑的比别人快 飞的比别人高 <br />将来大家看的都是我画的漫画 ,大家唱的都是 我写的歌 <br />妈妈的辛苦 不让你看见 ,温柔的事 是否在她心里面 <br />有空就多多握著她的手 ,把手牵著一起梦游 <br /><br />听妈妈的话 别让她受伤 ,想快快长大 才能保护她 <br />美丽的白发 幸福中发芽 ,天使的魔法 温暖中慈祥 ','1','','0','','1','/dpic/20120725/10954.jpg','1765','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVrVXpUbXBWZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/1765.swf','http://www.61baobao.com/common/flash/d/dpic/1765.jpg','http://www.61baobao.com/common/flash/d/pic/1765.jpg','0','三个月以上','0','','0','','0','0','0');");
