E_D("replace into `phome_ecms_game` values('6342','14','2','','','','1','admin','|1|26|','1','0','1343237306','0','0','0','0','','','6342','0','0','0','0','0','0','长江我的家','1343237306','/spic/20120725/11402.jpg','0','1','1343237306','0','3','1','0','','0','','/d/file/swf/changjiang.swf','667','479','小河它有家，小鸟它有家，我也有个我爱的家；小草有妈妈，小树有妈妈，我也有个爱我的妈妈。 <br />长江长江是我的家，长江是我的妈妈，心里装着妈妈的爱，走遍天涯想着家。 <br />小河流走啦，小鸟飞走啦，他们是不是想回家；小草长高啦，小树长高啦，他们忘不了的是妈妈。 <br />长江长江是我的家，长江是我的妈妈，心里装着妈妈的爱，走遍天涯想着家。我也想回家，我要去看妈妈，心里装着妈妈的爱，走遍天涯想着家。','1','','0','','1','/dpic/20120725/11405.jpg','1552','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXpUREpPYjFsWE5XNWhiV3hvWW0xamRXTXpaRzA9','2','0','http://s.61baobao.com/common/flash/2007/changjiang.swf','http://www.61baobao.com/common/flash/2007/dpic/changjiang.jpg','http://www.61baobao.com/common/flash/2007/pic/1552.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6343','14','0','','','','1','admin','|1|','1','0','1343237306','0','0','0','0','','','6343','0','0','0','0','0','0','波斯猫','1343237306','/spic/20120725/11409.jpg','0','1','1343237306','0','3','1','0','','0','','/d/file/swf/boshimao.swf','667','479','眼眯成一条线轻轻踮着脚尖<br />屋顶上的瓦片是他的琴键<br />一步步一点点游走在爱情边缘<br /><br />想出现就出现想不见就不见<br />想睡就睡一天不理任何人<br />不回电不上线不会和任何人争辩<br /><br />爱上他危险危险不爱他思念思念<br />他总是若即若离若隐若现<br />有时候沈默冰冷有时候温柔腼腆<br />任谁都不会是他爱情的主人<br /><br />靠近时缠绵缠绵离开时敷衍敷衍<br />他总是忽热忽冷忽近忽远<br />他可以一成不变也可以瞬息万变<br />但是他不会为你做任何改变<br /><br />波斯猫眯着他的双眼波斯猫踮着他的脚尖<br />波斯猫守着他的爱恋一转眼却又看不见<br /><br />什么他都看见什么都没看见<br />无谓的耸耸肩是他的消遣<br />左一遍右一遍等待着他的有情人','1','','0','','1','/dpic/20120725/11411.jpg','1542','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXpUREpLZG1NeWFIQmlWMFoyVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2007/boshimao.swf','http://www.61baobao.com/common/flash/2007/dpic/boshimao.jpg','http://www.61baobao.com/common/flash/2007/pic/1542.jpg','0','三个月以上','0','','0','','0','0','0');");
